import DELETE from "./Delete";
import Get from "./Get";
import POST from "./Post";

//getuser
const getUser = () => Get('user/all');

//postuser
const postUser = (data) => POST('user/save',data);

//deleteuser
const deleteUser = (id) => DELETE(`delus/${id}`);


const GENI = {
    getUser,
    postUser,
    deleteUser
}

export default GENI;
